import {FiSearch} from 'react-icons/fi'
import styled from 'styled-components';
const Search = () => {
    return(
        <Wrapper>
        <InputIcon>
        <InconWrapper><FiSearch  size={16} color='hsl(0, 0%, 29%)'/></InconWrapper> 
        <Input placeholder="Search sheikh,topics,books..." type="text" />
        </InputIcon>
        <Button>Log In</Button>
        </Wrapper>


    )
}
const Wrapper = styled.div`
padding-top:24px;
padding-left:24px;
display:flex;
align-items:baseline;
width:800px;

`
const InputIcon = styled.label`
display:block;
position:relative;
margin-right:auto;
`
const Input = styled.input`
height:${24 / 16} rem;
padding-left:26px;
border:none;


/* border-bottom:1px solid #309f5e; */
width:200px;
`
const InconWrapper = styled.div`
position:absolute;
top:0%;
bottom:0;
margin:auto 0;
height:16px;
`
const Button = styled.button`
font-size:${16/16}rem;
padding:4px 12px;
border-radius:2px;
background-color:#309F5E;
border:2px solid transparent;
color:white;
&:hover {
    background-color:hsl(90, 100%, 27%);
}
`
export default Search;
